        </Link> */}

        <Link to="/signup">
          <button type="button" className="button">
            Open
          </button>
        </Link>

        <h2 className="handle"></h2>
        <h3 className="square2 font">
          {cMonth}/{cDay}/{cYear}
        </h3>
        <h4 className="line"></h4>
        <h5 className="handle2"></h5>
        <button type="button" className="button2">
          Date
        </button>
      </div>
    </>
  );
}

export default Home;
